import { Trainer } from "../models/Trainer";

const trainers = [
  new Trainer(1, "John Doe", "john@example.com", "1234567890", "Java", [
    "Spring",
    "Hibernate",
  ]),
  new Trainer(2, "Jane Smith", "jane@example.com", "0987654321", "React", [
    "Hooks",
    "Redux",
  ]),
  new Trainer(3, "Amit Sharma", "amit@example.com", "9876543210", "Python", [
    "Flask",
    "Pandas",
  ]),
];

export default trainers;
